    }
    return (
        <div className="card">
            <Card title="Authenticate user" style={{ width: '70%', align: 'center'}}>
                <Toast ref={toast} />
                <form onSubmit={handleClick}>
                    <div className="p-field p-grid">
                        <label htmlFor="Title" className="p-col-12 p-md-2">Email</label>
